import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

import Setting from "../component/setting";
import Messages from "../component/message";

import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import {
  Grid,
  Stack,
  Typography,
  Divider,
  Drawer,
  Avatar,
  Paper,
} from "@mui/material";
import { Box } from "@mui/system";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemButton from "@mui/material/ListItemButton";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import MailIcon from "@mui/icons-material/Mail";
import MenuIcon from "@mui/icons-material/Menu";
import InboxIcon from "@mui/icons-material/MoveToInbox";
import DashboardPart from "../component/dashboardPart"

import adjustPaper from "../common/adjustPaperfiile";
import SimplePaper from "../common/paper";

import SearchAppBar from "../common/appBar";

import Inbox from "../screens/inbox"



function Dashboard(props) {
  const { state } = useLocation();

  const navigate = useNavigate();

  const navigatedynamically = (path) => {
    navigate(`${path}`, { state: { name: "abc" } });
  };
  const list = (anchor) => (
    <Box>
      <List>
        {["Inbox", "Starred", "Sendemail", "Drafts"].map((text, index) => (
          <ListItem key={text} disablePadding>
            {/* <Link to ="/show"> */}
            <ListItemButton onClick={() => {navigatedynamically(text)}}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItemButton>
            {/* </Link> */}
          </ListItem>
        ))}
      </List>
      <Divider />
      <List>
        {["All mail", "Trash", "Spam"].map((text, index) => (
          <ListItem key={text} disablePadding>
            <ListItemButton>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
    </Box>
  );

  return (
    <div>
      <Grid container>
        <Grid
          item
          xs={0}
          sm={0}
          lg={0}
          xl={3}
          padding={1}
          sx={{ display: { xs: "none", sm: "block" } }}
        >
          <Box sx={{ border: "1px solid" }}>
            <Typography variant="h3" align="center">
              Dashboard
            </Typography>
            {list()}
          </Box>
        </Grid>
      </Grid>
      <Routes>
        
        <Route path = "/Inbox" element ={<Inbox/>} /> 
        <Route path = "/Starred" element ={<DashboardPart/>} /> 
      </Routes>
    
    </div>
  );
}

export default Dashboard;
